    <script>
      document.addEventListener("DOMContentLoaded", function() {
        const searchButton = document.getElementById('searchButton');
        const postcodeInput = document.getElementById('postcodeInput');
        const hoursInput = document.getElementById('hoursInput');
        const searchResult = document.getElementById('searchResult');
        const mapDiv = document.querySelector('#map-container .plotly-graph-div');
        const barChartDiv = document.getElementById('barChartDiv');
        const chartContainer = document.getElementById('chart-container');
          
        if (typeof Plotly !== 'undefined') {
            const mapObserver = new ResizeObserver(() => { Plotly.Plots.resize(mapDiv); });
            mapObserver.observe(document.getElementById('map-container'));
              
            const chartObserver = new ResizeObserver(() => { Plotly.Plots.resize(barChartDiv); });
            chartObserver.observe(chartContainer);
        } else {
            console.error("Plotly.js not loaded. Cannot set up resize observers.");
        }

        function performCalculation() {
          const userPostcode = postcodeInput.value.toUpperCase();
          const userInput = userPostcode.replace(/\s+/g, '');
          const hours = parseFloat(hoursInput.value);
          const lsoaCode = postcodeData[userInput];

          searchResult.innerHTML = ''; 
          Plotly.purge(barChartDiv);
          
          if (!lsoaCode) { 
              searchResult.textContent = 'Postcode not found in the service area.'; 
              chartContainer.style.display = 'none';
              return; 
          }
          if (isNaN(hours) || hours <= 0) { 
              searchResult.textContent = 'Please enter a valid number of hours per week.'; 
              chartContainer.style.display = 'none';
              return; 
          }

          if (lsoaData[lsoaCode]) {
            const data = lsoaData[lsoaCode];
            const weeksInMonth = 4.33;

            const minHourly = Math.min(...data.providers).toFixed(2);
            const maxHourly = Math.max(...data.providers).toFixed(2);
            const avgHourly = data.avg_cost.toFixed(2);
            
            let baseText = `<p>In <strong>${userPostcode}</strong> the average hourly cost of care is £${avgHourly}, with a range from £${minHourly} to £${maxHourly}.</p>`;
            const linkText = `<p>Find out more about our care services in <a href="https://www.homacare.co.uk/areas-we-cover" target="_blank" style="color: #007bff; text-decoration: none;">your area today</a>.</p>`;

            const providerMonthlyCosts = data.providers.map(hourlyRate => (hourlyRate * hours) * weeksInMonth);
            const avgProviderCost = providerMonthlyCosts.length > 0 ? providerMonthlyCosts.reduce((a, b) => a + b, 0) / providerMonthlyCosts.length : 0;
            const homaCareMonthlyCost = (hours * 20 * weeksInMonth) + 150;

            updateMap(lsoaCode, data.centroid);
            
            // --- REDRAW FIX: Use requestAnimationFrame to prevent a race condition ---
            // This ensures the container is visible and has its dimensions calculated before we draw the chart.
            chartContainer.style.display = 'flex';
            requestAnimationFrame(() => {
                createBarChart(data, hours, providerMonthlyCosts, homaCareMonthlyCost, avgProviderCost);
                
                if (avgProviderCost > 0 && homaCareMonthlyCost < avgProviderCost) {
                    const annualSavings = Math.round((avgProviderCost - homaCareMonthlyCost) * 12);
                    const totalMonthlyHours = hours * weeksInMonth;
                    const effectiveHomaCareHourlyRate = homaCareMonthlyCost / totalMonthlyHours;
                    const extraHoursPerYear = Math.round(annualSavings / effectiveHomaCareHourlyRate);
                    
                    let savingsText = `<p>With HomaCare, you could benefit from extraordinary proactive, prevention-focused care that prolongs time spent healthy at home, all while saving an estimated <strong style="color: #273f24;">£${annualSavings.toLocaleString()} per year</strong>. That's equivalent to an extra <strong>${extraHoursPerYear} hours</strong> of care.</p>`;
                    searchResult.innerHTML = baseText + savingsText + linkText;
                } else {
                    const proactiveCareText = `<p>With HomaCare you could benefit from extraordinary proactive, prevention-focused care that prolongs time spent healthy at home, reducing the need for more hours of care in the future or a change of care setting.</p>`;
                    searchResult.innerHTML = baseText + proactiveCareText + linkText;
                }
            });
            
          } else { 
            searchResult.textContent = 'No provider data available for this specific area.'; 
            chartContainer.style.display = 'none';
          }
        }
          
        function updateMap(lsoaCode, centroid) {
            const originalTrace = mapDiv.data[0];
            const featureIndex = originalTrace.locations.indexOf(lsoaCode);
            if (featureIndex === -1) return;
            const selectedFeature = originalTrace.geojson.features[featureIndex];
            const highlightTrace = {
                type: 'choroplethmapbox', geojson: {type: 'FeatureCollection', features: [selectedFeature]},
                locations: [lsoaCode], z: [0], showscale: false,
                colorscale: [['0.0', 'rgba(255, 200, 0, 0.7)'], ['1.0', 'rgba(255, 200, 0, 0.7)']],
                hoverinfo: 'none'
            };
            if (mapDiv.data.length > 1) { Plotly.restyle(mapDiv, { geojson: [highlightTrace.geojson], locations: [highlightTrace.locations], visible: true }, [1]);
            } else { Plotly.addTraces(mapDiv, highlightTrace); }
            Plotly.relayout(mapDiv, { 'mapbox.center.lat': centroid.centroid_lat, 'mapbox.center.lon': centroid.centroid_lon, 'mapbox.zoom': 13 });
        }

        function createBarChart(data, hours, providerMonthlyCosts, homaCareMonthlyCost, avgProviderCost) {
            const allCosts = providerMonthlyCosts.map((cost, i) => ({ cost: cost, label: `Provider ${i+1}`, color: '#adb5bd' }));
            allCosts.push({ cost: homaCareMonthlyCost, label: 'HomaCare', color: '#273f24' });
            allCosts.sort((a, b) => a.cost - b.cost);
              
            const homaCareIndex = allCosts.findIndex(d => d.label === 'HomaCare');

            const chartData = [{
                x: allCosts.map(d => d.label), y: allCosts.map(d => d.cost),
                type: 'bar', marker: { color: allCosts.map(d => d.color) },
                showlegend: false,
                hovertemplate: '<b>%{x}</b><br>Cost: £%{y:.2f}<extra></extra>'
            }];
            
            const layout = {
                title: 'Estimated Monthly Cost Comparison',
                xaxis: {
                    tickmode: 'array',
                    tickvals: [homaCareIndex],
                    ticktext: ['HomaCare'],
                    fixedrange: true
                },
                yaxis: { 
                    title: 'Estimated Cost per Month (£)', 
                    showtickson: 'both', 
                    minor: { ticks: 'inside', ticklen: 4, showgrid: false },
                    rangemode: 'tozero',
                    fixedrange: true
                },
                shapes: [ { type: 'line', x0: -0.5, y0: avgProviderCost, x1: allCosts.length - 0.5, y1: avgProviderCost, line: { color: 'black', width: 2, dash: 'dash' } }],
                annotations: [
                    {
                        x: allCosts.length - 0.5,
                        y: avgProviderCost,
                        xref: 'x',
                        yref: 'y',
                        text: 'Average',
                        showarrow: false,
                        xanchor: 'left',
                        yanchor: 'bottom',
                        font: {
                            color: 'black'
                        }
                    }
                ],
                autosize: true, margin: { t: 40, b: 40, l: 60, r: 20 },
                paper_bgcolor: 'rgba(0,0,0,0)', plot_bgcolor: 'rgba(0,0,0,0)'
            };

            const config = { displayModeBar: false, responsive: true };
            
            Plotly.newPlot(barChartDiv, chartData, layout, config);
        }
        searchButton.addEventListener('click', performCalculation);
      });
    </script>
